import React from "react";
import { Route, Routes } from "react-router-dom";

// Routes
import HomePageDisplay from "./components/homePage";
import MainPageDisplay from "./components/mainPage";

function App() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<HomePageDisplay />} />
        <Route path="/mainPage" element={<MainPageDisplay />} />
      </Routes>
    </div>
  );
}

export default App;
